import Creators from "./Creators";
import Categories from "./Categories";
import Discover from "./Discover";
import Featured from "./Featured";
import HowItWorks from "./HowItWorks";

const Main = () => {
  return (
    <main>
      <Collection />
      <Creators />
      <Categories />
      <Discover />
      <Featured />
      <HowItWorks />
    </main>
  );
};

export default Main;
